import { CREATE_PICTURE } from '../constants/types'

const initialState = {
    images:[]
}

export default (state = initialState, action) => {

    switch (action.type) {
        case CREATE_PICTURE:{
            state.images.push(action.payload)
            return{
                ...state
            }
        }
        default:
            return state
    }

}
